if it takes 8 hours to fly to Singapore, stop over for an hour and a half and then fly 14 hours to London then what is the total travel time if the plane is delayed in Singapore for 2 hours?

A:

The total travel time is:
$$
\begin{align}
\text{Total travel time} &= \text{Delayed travel time} + \text{Non-delayed travel time} \\
&= 2\text{ hours} + 14\text{ hours} \\
&= 16\text{ hours}
\end{align}
$$

